import React from 'react';
import '../App.css';
import './Section.css';

function Section() {
    return (
        <div className='section-container'>
            <h1>I believe every brand should have <br/> a stunning web experience.</h1>
            <p>
                I bring brands to live with stunning web experiences using cutting edge development techniques.
                <br/>
                I create mobile-first, responsive web designs from a user's perspective.
                <br/>
                I custom build every site based on each client's specific needs.
            </p>
        </div>
    );
}

export default Section;
